Arnold de Lantin's music was held in high regard, and appears alongside that of Dufay, Gilles Binchois and Johannes Ciconia in contemporary manuscript collections. In particular, one motet with text from Song of Songs — Tota pulchra es — is found in widely distributed sources; since this was before the advent of printing technology, wide distribution of copies is taken as evidence of a composer's fame and popularity. Musically Arnold's mass movements are fairly simple, using three voices, head motif technique, and avoiding imitative writing. Some of his other sacred music, such as his Marian motets, contain florid melodic writing and some use of imitation.

Tota pulchra es, amica mea, et macula non est in te;
favus distillans labia tua; mel et lac sub lingua tua;
odor unguentorum tuorum super omnia aromata:
jam enim hiems transiit, imber abiit et recessit.
Flores apparuerunt;
vineae florentes odorem dederunt,
et vox turturis audita est in terra nostra:
surge, propera, amica mea:
veni de Libano, veni, coronaberis.

